module P341 where

import Common
import qualified Data.Set as S
import Debug.Trace

main = print $ sum [g (n ^ 3) | n <- [m - 1, m - 2 .. 1]]

m = 1000000

phi :: Double
phi = (1 + sqrt 5) / 2

h :: Integer -> Integer
h n = round (phi ** (2 - phi) * fromInteger n ** (phi - 1))

g :: Integer -> Integer
g 1 = 1
g 2 = 2
g 3 = 2
g n
  | n <= 12600 = h n + fromIntegral (fromEnum (S.member n add))
  | n <= 30000 = h n - fromIntegral (fromEnum (S.member n sub))
  | otherwise = 1 + g' 2 (n - 2)

g' :: Integer -> Integer -> Integer
g' k n
  | n > k && n >= small && n >= big && n >= huge = s * sumBet f (f + t) + g' (k + s * t) (n - huge)
  | n > k && n >= small && n >= big = f * s + g' (k + s) (n - big)
  | n > k && n >= small = f + g' (k + 1) (n - small)
  | otherwise = n `div` k + 1
  where
    huge = sumGroup k f s t
    big = f * sumBet k (k + s)
    small = k * f
    f = g k
    s = g f
    t = g s

sumTo :: Integral a => a -> a
sumTo n = (n ^ 2 - n) `div` 2

sumBet :: Integral a => a -> a -> a
sumBet a b = sumTo b - sumTo a

sumGroup :: Integral a => a -> a -> a -> a -> a
sumGroup k f s t =
  t * sumTo (k + s * t) + (f - 1) * sumBet k (k + s * t)
    - k * s * sumTo t
    - (t * (k ^ 2 - k) - s * sumTo t + s ^ 2 * (t - 1) * t * (2 * t - 1) `div` 6) `div` 2

